/**
 * 企业发展历程
 */
import React, {Component} from 'react';
import {Timeline} from 'antd';
import {ClockCircleOutlined, DollarCircleOutlined, RocketOutlined, TrophyOutlined} from '@ant-design/icons';
import courseStyle from './index.module.css';

class Course extends Component {
    render() {
        return (
                <Timeline mode="alternate" pending='创新永不止步，奇迹正在诞生......'>
                    <Timeline.Item><b>2021.05.01</b> 飞云在成都市高新区注册成立</Timeline.Item>
                    <Timeline.Item><b>2021.10.01</b> 飞云注册企业突破50家，服务企业用户30,000+</Timeline.Item>
                    <Timeline.Item className={courseStyle.item} dot={<DollarCircleOutlined style={{fontSize: '16px',color:'#FF881A'}}/>}>
                        <b>2022.02.20</b> 飞云获得A轮融资2000万美元
                    </Timeline.Item>
                    <Timeline.Item dot={<TrophyOutlined style={{fontSize: '16px',color:'#FF1A1D'}}/>}>
                        <b>2022.04.16</b> 飞云荣获<b>“2021年度十大ERP解决方案”</b>金奖
                    </Timeline.Item>
                    <Timeline.Item dot={<DollarCircleOutlined style={{fontSize: '16px',color:'#FF881A'}}/>}>
                        <b>2022.07.23</b> 飞云再获B轮融资8000万美元
                    </Timeline.Item>
                    <Timeline.Item dot={<RocketOutlined style={{fontSize: '16px',color:'#FF1A1D'}}/>}>
                        <b>2022.07.23</b> 飞云注册企业突破500家，服务企业用户1,000,000+
                    </Timeline.Item>
                    <Timeline.Item dot={<DollarCircleOutlined style={{fontSize: '16px',color:'#FF881A'}}/>}>
                        <b>2022.12.31</b> 飞云年度营收2.8亿美元，同比扭亏盈利
                    </Timeline.Item>
                </Timeline>
        );
    }
}

export default Course;
